        <h1>
          <i className='fas fa-exclamation-triangle'></i> Random Image
        </h1>
        <div>
          <img src='' />
          <button>Get a random image</button>
          <button>Refresh</button>
        </div>
      </div>
    </Fragment>
  );
};
*/
function Images() {
  let yellow = '#ffc800';
  const [bgColor, setBgColor] = useState(yellow);
   const changeColor =()=>{
      let purple = '#A020F0';
      setBgColor(purple);
    }
  return (
    <div className="App">
      <header className="App-header" style={{background: bgColor}}>
        <button onClick={changeColor}>Change Color</button>
      </header>
    </div>
  );
}

export default Images;
